import FooPages from './pages/FooPages';
import BarPages from './pages/BarPages';
import { createRouter, createWebHistory } from "vue-router";


const routes = [
  {
    path: '/foo',
    component: FooPages
  },
    {
    path: '/bar',
    component: BarPages
  },
]


const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router
